import React, { useState, useEffect } from 'react';
import Axios from 'axios';

const VideoList = () => {

    const [list, setList] = useState([]);

    useEffect(() =>{
        // fetch('/api/products')
        // .then(function (response) { return response.json();})
        // .then(data => { setProducts(data);});
    //------using Axios --------------
    //console.log(fetchData);
    const fetchData = async () => {
       await Axios.get("https://stgapi.omnicuris.com/api/v3/courses?courseSlug=thyroid-in-pregnancy", {
          headers: {
            'hk-access-token': '89e684ac-7ade-4cd8-bbdf-419a92f4cc5f'
          }
      })
      .then(response => {
          setList(response.data.courseDetails.modules);
          
      })
    }

    fetchData();

      return ()=> {
        //
      };
    },[]);

    console.log(list);

    const renderList= () => {
        return list.map(l => {
            console.log(l);
            return (
                <div className="item">

                    <img alt ={l.title} className="ui image" src ={l.moduleExperts.profilePic} />
                    <div className="content">
                        <div className="header">{l.title}</div>
                    </div>
                </div>
            )
        })
    }



    return <div className="ui relaxed divided list">{renderList}</div>
}

export default VideoList;
